    <style>
        html,
        body {
            background-color: #000000;
           
            repeat: no-repeat;
            background-size: cover;
            overflow-x: hidden;
            margin: 5px;
        }
        
        img {
            width: auto;
            max-width: 100%;
            height: auto;
        }
        
        .respie {
            width: 100%;
            max-width: 100%;
            height: auto;
        }
        
        #sl3d {
            margin-left: 0;
        }
        
        .wrapper {
            position: relative;
            margin-top: 320px;
      
            margin-right: auto;
            /* 1 */
            margin-left: auto;
            /* 1 */
            max-width: 1160px;
            /* 2 */
            padding-right: 10px;
            /* 3 */
            padding-left: 10px;
            /* 3 */
        }
        
        #long {
            width: 1350px"

        }
   
        a {
            color: rgb(203, 41, 41);
        }
        
        h1 {
            font-family: 'Josefin Sans', sans-serif;
            color: #fff;
            font-size: 60px;
        }
        
        h2 {
            font-family: 'Josefin Sans', sans-serif;
            color: #fff;
        }
        
        h3 {
            font-family: 'JetBrains Mono', monospace;
            color: #fff;
        }
        /* Dotted border */
hr.dotted {
  border-top: 3px dotted #bbb;
}
        
        h4 {
            font-family: 'JetBrains Mono', monospace;
            color: #0eb356;
        }
        
        article {
            display: block;
            width: auto;
        }
        
        body {
            font-family: sans-serif;
        }
        
        .TradeGothicLTRoman {
            font-family: 'Trade Gothic LT W01 Roman';
        }
        
        .TradeGothicLTOblique {
            font-family: 'Trade Gothic LT W01 Oblique';
        }
        
        .TradeGothicLTBold {
            font-family: 'Trade Gothic LT W01 Bold';
        }
        
        .TradeGothicLTBoldCondensed {
            font-family: 'Trade Gothic LT W01 Bd CnNo-20';
        }
        
        .respi {
            margin-left: -10%;
            position: absolute;
        }
        
        .button {
            display: inline-block;
            padding: 6px 10px;
            font-size: 15px;
            cursor: pointer;
            text-align: center;
            text-decoration: none;
            outline: none;
            color: #fff;
            background-color: rgb(188, 20, 73);
            border: none;
            border-radius: 6px;
            box-shadow: 0 3px #999;
        }
        
        .button:active {
            background-color: rgb(233, 109, 181);
            box-shadow: 0 5px #666;
            transform: translateY(4px);
            color: white;
        }
        
        .button {
            transition-duration: 0.4s;
            color: white;
        }
        
        .form {
            color: white;
        }
        
        .button:hover {
            background-color: rgb(177, 103, 223);
            color: white;
        }
        
        h1 {
            text-shadow: 2px 4px #1c1b1b;
            overflow: auto;
            white-space: nowrap;
        }
        
        a {
            color: white;
        }
        
        .styledtext {
            font-family: 'Kavivanar', cursive;
            font-size: 90px;
            justify: center;
            Align-items: center;
            color: #000000;
        }
        
      
      
        
        #overlay {
            position: fixed;
            display: visible;
            width: 100%;
            height: 100%;
            top: 0;
            left: 0;
            right: 0;
            bottom: 0;
            background-color: rgba(0, 0, 0, 0.8);
            z-index: 10999;
            cursor: pointer;
        }
        
        #text {
            position: absolute;
            top: 50%;
            left: 50%;
            font-size: 50px;
            color: white;
            transform: translate(-50%, -50%);
            -ms-transform: translate(-50%, -50%);
        }
        #babylon {
            width:"115"
        }
        #age,
        #age_no {
            position: relative;
            top: 70%;
            left: 40%;
            font-size: 50px;
            color: rgb(70, 14, 123);
            transform: translate(-50%, -50%);
            -ms-transform: translate(-50%, -50%);
        }
        #portrait {
            position:absolute;
            margin-top:0px;
            margin-right: 25px;
            margin-left:65%;
            height:400px;
        }
        
        @import "//cdnjs.cloudflare.com/ajax/libs/font-awesome/4.5.0/css/font-awesome.css";
        @mixin clearfix() {
            *zoom: 1;
            &:before,
            &:after {
                content: " ";
                display: table;
            }
            &:after {
                clear: both;
                display: block;
                font-size: 0;
                height: 0;
                visibility: hidden;
            }
        }
        
        #navbar {
            position: relative;
            margin-left: 40%;
            margin-right: 40%;
            margin-top:67px;
        }
        
      
        
        header {
            background-color: black;
        }
        
        #banner {
            position: relative;
            margin-left: -5%;
          
        }
        
        .container {
            flex-direction: row;
            margin-left: 50%;
            margin-right: 0px;
            margin-top:5px;
            margin-bottom:77%;
            width:100%;
        }
        
        .container_right {
            flex-direction: row;
            margin-left: 0px;
            flex-direction: row;
            margin-right: 10%;
           
        }
        
        @mixin media($type) {
            @if $type==tablet {
                /* Small devices (tablets, 768px and up) */
                @media (min-width: 768px) and (max-width: 991px) {
                    @content;
                }
            }
            @else if $type==mediumDesktop {
                /* Medium devices (desktops, 992px and up) */
                @media (min-width: 992px) and (max-width: 1100px) {
                    @content;
                }
            }
            @else if $type==largeDesktop {
                /* Large devices (large desktops, 1200px and up) */
                @media (min-width: 1200px) {
                    @content;
                }
            }
        }
    </style>
